import styled from 'styled-components';

export const StyledNote = styled.div`
    .note{
        width:500px;
        border: 1px solid black; 
        padding: 20px;
        margin-left:40%;
    }
    input{
        width: 300px;
        height: 20px;
        padding: 10px;
        margin: 5px;
        font-size: 18px;
    }
`;
